import React from "react";
import "./About.css"; // Import the CSS file

const About = () => {
  return (
    <div className="about-container">
      <h1 className="about-header">About Us</h1>
      <p className="about-text">
        Welcome to our website! We are passionate about delivering high-quality
        products and exceptional services to our customers.
      </p>
      <p className="about-text">
        Our mission is to innovate and create solutions that make a difference
        in people's lives. With years of experience and a dedicated team, we
        strive to exceed your expectations.
      </p>
      <p className="about-text">
        Thank you for choosing us. Feel free to explore our website and learn
        more about what we have to offer.
      </p>
    </div>
  );
};

export default About;
